import React from 'react';
import MenuList from './MenuItems';


const MenuCards = () => {
    return (
        <>
            {
                MenuList.map((val, ind) => {
                    return (
                        <>
                            <div className='col-md-4 mb-2'>
                                <div className="card">
                                    <img className="card-img-top" src={val.img} alt="Card image" />
                                    <div className="card-body">
                                        <h4 className="card-title d-flex justify-content-between align-items-center">{val.item} <span class='price'>{val.price}</span></h4>
                                        <p className="card-text">{val.description}</p>
                                        <h5 className="card-cat">{val.category}</h5>
                                        <a href="#" className="btn btn-primary">Read More</a>
                                    </div>
                                </div>
                            </div>
                        </>
                    )

                })
            }

        </>
    )
}

export default MenuCards
